import React from 'react'
import * as FaIcons from 'react-icons/fa';
import {Link} from 'react-router-dom'
const Sidebar = () => {
  return (
    <div className='sidebar'>
        <a> this is a side bar</a>
        <Link to="#" className='munu-bars'>
            <FaIcons.FaBars />
        </Link>
    </div>

  )
}

export default Sidebar
